import React, { Fragment } from 'react';

import Navbar from '../../includes/NavBar'
import Footer from '../../includes/Footer'
import AboutUs from '../../includes/AboutUs'

function About() {
    return (
        <Fragment >
            <Navbar />
            <AboutUs />
            <Footer />
        </Fragment>
    );
}

export default About;
